import { Link } from "react-router-dom";
import "./style.css";
function Header() {
  return (
    <header>
      <a href="/">
        <img
          className="imagemLogo"
          src="https://youxgroup.com.br/wp-content/uploads/2021/07/logosite.png"
        />
      </a>
      <div className="menu">
        <Link to="/">Home</Link>
        <Link to="/logout">Logout</Link>
      </div>

      <div>
        <hr className="vertical"></hr>
      </div>
    </header>
  );
}

export default Header;
